    /** pdoc search index */const docs = [{"fullname": "app", "modulename": "app", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>The <strong>BigData &amp; Tools USASpending Application</strong> is a comprehensive system designed to process, analyze, and visualize USASpending data. Leveraging powerful big data technologies such as Apache Spark and Cassandra, the application offers robust functionalities including:</p>\n\n<ul>\n<li><strong>Data Processing &amp; Aggregation:</strong> Extracts, transforms, and loads award data, aggregating amounts by recipient and sub-agency.</li>\n<li><strong>Geolocation Data Retrieval:</strong> Processes recipient names to obtain geographical coordinates using the Nominatim API.</li>\n<li><strong>Machine Learning:</strong> Implements regression, classification, and clustering models to analyze award trends and predict outcomes.</li>\n<li><strong>API &amp; Visualization:</strong> Provides endpoints for data visualization dashboards and machine learning inference, enabling interactive data exploration.</li>\n<li><strong>ETL Pipelines:</strong> Automates the Extract, Transform, Load processes to ensure efficient and scalable data handling.</li>\n<li><strong>Logging &amp; Configuration:</strong> Incorporates comprehensive logging and configurable settings to maintain robust and maintainable operations.</li>\n</ul>\n\n<p>This application is built with scalability and efficiency in mind, ensuring seamless handling of large datasets while providing insightful analytics and visualizations for informed decision-making.</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-21</p>\n"}, {"fullname": "app.config", "modulename": "app.config", "kind": "module", "doc": "<p></p>\n"}, {"fullname": "app.config.CASSANDRA_HOST", "modulename": "app.config", "qualname": "CASSANDRA_HOST", "kind": "variable", "doc": "<p></p>\n", "default_value": "&#x27;127.0.0.1&#x27;"}, {"fullname": "app.config.CASSANDRA_PORT", "modulename": "app.config", "qualname": "CASSANDRA_PORT", "kind": "variable", "doc": "<p></p>\n", "default_value": "&#x27;9042&#x27;"}, {"fullname": "app.fetch_awarding_sub_agency_geo_data", "modulename": "app.fetch_awarding_sub_agency_geo_data", "kind": "module", "doc": "<p></p>\n"}, {"fullname": "app.fetch_awarding_sub_agency_geo_data.logger", "modulename": "app.fetch_awarding_sub_agency_geo_data", "qualname": "logger", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Logger usaspending (INFO)&gt;"}, {"fullname": "app.fetch_awarding_sub_agency_geo_data.get_geolocation", "modulename": "app.fetch_awarding_sub_agency_geo_data", "qualname": "get_geolocation", "kind": "function", "doc": "<p></p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"param\"><span class=\"n\">name</span></span><span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.fetch_awarding_sub_agency_geo_data.main", "modulename": "app.fetch_awarding_sub_agency_geo_data", "qualname": "main", "kind": "function", "doc": "<p></p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.fetch_recipient_name_geo_data", "modulename": "app.fetch_recipient_name_geo_data", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>Processes recipient names from the Cassandra <code>awards</code> table, counts their occurrences, retrieves geolocation data for\ntop recipients using the Nominatim API, and stores the geolocation information back into the Cassandra database.</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-21</p>\n"}, {"fullname": "app.fetch_recipient_name_geo_data.logger", "modulename": "app.fetch_recipient_name_geo_data", "qualname": "logger", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Logger usaspending (INFO)&gt;"}, {"fullname": "app.fetch_recipient_name_geo_data.get_geolocation", "modulename": "app.fetch_recipient_name_geo_data", "qualname": "get_geolocation", "kind": "function", "doc": "<p>Retrieve the geographical coordinates (latitude and longitude) for a given location name.</p>\n\n<p>This function queries the Nominatim API from OpenStreetMap to obtain the geolocation data.</p>\n\n<p>Args:\n    name (str): The name of the location to geocode.</p>\n\n<p>Returns:\n    Tuple[Optional[float], Optional[float]]:\n        A tuple containing the latitude and longitude as floats if found,\n        otherwise (None, None).</p>\n\n<p>Example:<br>\n    <code>&gt;&gt;&gt; lat, lon = get_geolocation(\"New York\")</code><br>\n    <code>&gt;&gt;&gt; print(lat, lon)</code><br>\n    <code>40.7127281 -74.0060152</code></p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"param\"><span class=\"n\">name</span></span><span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.fetch_recipient_name_geo_data.fetch_recipient", "modulename": "app.fetch_recipient_name_geo_data", "qualname": "fetch_recipient", "kind": "function", "doc": "<p>This function for processing recipient names and storing their geolocations.</p>\n\n<p>This function connects to a Cassandra cluster, retrieves recipient names from the\n'awards' table, counts the occurrences of each recipient, fetches geolocation data\nfor the top recipients, and inserts the geolocation data into the 'recipient_name_with_geo'\ntable.</p>\n\n<p>Steps:\n    1. Connect to the Cassandra cluster using configuration parameters.\n    2. Fetch all <code>recipient_name</code> entries from the <code>awards</code> table.\n    3. Count the occurrences of each unique <code>recipient_name</code>.\n    4. Log the total number of unique recipient names and the top recipients by award count.\n    5. Fetch geolocation data for the top recipients (up to a maximum limit).\n    6. Insert the collected geolocation data into the Cassandra table.\n    7. Shutdown the Cassandra cluster connection.</p>\n\n<p>Raises:\n    None</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.logging_config", "modulename": "app.logging_config", "kind": "module", "doc": "<p></p>\n"}, {"fullname": "app.logging_config.setup_logging", "modulename": "app.logging_config", "qualname": "setup_logging", "kind": "function", "doc": "<p></p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.machine_learning_models", "modulename": "app.machine_learning_models", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>This module is a core component of the <strong>BigData &amp; Tools USASpending Application</strong>. It is responsible for:</p>\n\n<ul>\n<li><strong>Data Ingestion:</strong> Connecting to a Cassandra database to retrieve USASpending award data.</li>\n<li><strong>Data Preprocessing:</strong> Cleaning the data by handling missing values, extracting temporal features (month and year), and filtering out invalid records.</li>\n<li><strong>Correlation Analysis:</strong> Performing correlation computations on numerical and categorical features and generating a heatmap visualization to identify relationships between variables.</li>\n<li><strong>Machine Learning Pipelines:</strong> Building and training pipelines for three machine learning tasks:</li>\n<li><strong>Regression:</strong> Predicting award amounts using Linear Regression.</li>\n<li><strong>Classification:</strong> Categorizing awards into high or low based on the median award amount using Logistic Regression.</li>\n<li><strong>Clustering:</strong> Grouping awards into clusters using K-Means clustering.</li>\n<li><strong>Model Evaluation and Saving:</strong> Evaluating the performance of the trained models, logging the results, and saving both the evaluation metrics and the trained pipeline models for future use.</li>\n</ul>\n\n<p>The module leverages PySpark for distributed data processing and machine learning, ensuring scalability and efficiency when handling large datasets. Additionally, it utilizes Matplotlib for generating visualizations and incorporates custom configuration and logging setups to maintain robust and maintainable code.</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-21</p>\n"}, {"fullname": "app.machine_learning_models.logger", "modulename": "app.machine_learning_models", "qualname": "logger", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Logger usaspending (INFO)&gt;"}, {"fullname": "app.machine_learning_models.machine_learning_pipeline", "modulename": "app.machine_learning_models", "qualname": "machine_learning_pipeline", "kind": "function", "doc": "<p>Executes the USASpending data processing and machine learning pipeline.</p>\n\n<p>This function performs the following steps:</p>\n\n<p>1).<strong>Setup Environment:</strong></p>\n\n<ul>\n<li>Creates necessary output directories if they do not exist.</li>\n<li>Initializes a Spark session with Cassandra configurations.</li>\n</ul>\n\n<p>2).<strong>Data Ingestion:</strong></p>\n\n<ul>\n<li>Reads award data from a Cassandra table into a Spark DataFrame.</li>\n</ul>\n\n<p>3).<strong>Data Preprocessing:</strong></p>\n\n<ul>\n<li>Drops rows with missing values in required columns.</li>\n<li>Extracts month and year from the <code>start_date</code>.</li>\n<li>Filters out records with non-positive award amounts.</li>\n<li>Identifies valid categorical columns based on distinct value counts.</li>\n</ul>\n\n<p>4).<strong>Correlation Analysis:</strong></p>\n\n<ul>\n<li>Indexes categorical columns.</li>\n<li>Assembles numeric features for correlation computation.</li>\n<li>Generates and saves a correlation heatmap if sufficient data is available.</li>\n</ul>\n\n<p>5).<strong>Pipeline Construction:</strong></p>\n\n<ul>\n<li>Builds separate pipelines for regression, classification, and clustering tasks.</li>\n<li>Includes stages for indexing, encoding, feature assembling, and model training.</li>\n</ul>\n\n<p>6).<strong>Model Training and Evaluation:</strong></p>\n\n<ul>\n<li>Splits data into training and testing sets.</li>\n<li>Fits each pipeline on the training data.</li>\n<li>Evaluates regression and classification models using RMSE and AUC metrics, respectively.</li>\n<li>Performs clustering using K-Means and retrieves cluster centers.</li>\n</ul>\n\n<p>7).<strong>Results Saving:</strong></p>\n\n<ul>\n<li>Compiles summary statistics and model evaluation metrics.</li>\n<li>Writes the compiled information to a text file.</li>\n<li>Saves the trained pipeline models for future use.</li>\n</ul>\n\n<p><strong>Logging:</strong></p>\n\n<ul>\n<li>Logs warnings for columns with insufficient distinct values.</li>\n<li>Logs warnings if correlation analysis or model evaluations are skipped due to lack of data.</li>\n</ul>\n\n<p><strong>Output:</strong></p>\n\n<ul>\n<li>Correlation heatmap saved as <code>static/images/correlation_heatmap.png</code>.</li>\n<li>Model training information saved in <code>outputs/model_training_info.txt</code>.</li>\n<li>Trained pipeline models saved in the <code>outputs</code> directory.</li>\n</ul>\n\n<p><strong>Dependencies:</strong></p>\n\n<ul>\n<li>Requires a running Cassandra instance with the appropriate keyspace and table.</li>\n<li>Utilizes PySpark for data processing and machine learning.</li>\n<li>Uses Matplotlib for visualization.</li>\n<li>Custom configuration and logging modules (<code>config</code>, <code>logging_config</code>).</li>\n</ul>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app", "modulename": "app.ml_app", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>This module implements a BigData application for interacting with USASpending data.\nIt provides various endpoints for data visualization, machine learning inference,\nand data management using big data tools such as Apache Spark and Cassandra.</p>\n\n<p><strong>Features:</strong></p>\n\n<ul>\n<li><strong>Dashboard:</strong> Displays award amounts by recipient and sub-agency.</li>\n<li><strong>Machine Learning Models:</strong> Implements regression, classification, and clustering models for award data.</li>\n<li><strong>Data Fetching &amp; Insertion:</strong> Retrieves data from the USASpending API and inserts it into Cassandra.</li>\n<li><strong>Correlation Visualization:</strong> Visualizes correlations within the data.</li>\n<li><strong>Download History Tracking:</strong> Keeps a log of data downloads.</li>\n</ul>\n\n<p><strong>Dependencies:</strong></p>\n\n<ul>\n<li><strong>Apache Spark:</strong> 3.4.4</li>\n<li><strong>Apache Cassandra:</strong> 4.1.7</li>\n<li><strong>Scala:</strong> 2.12.17</li>\n<li><strong>Python:</strong> 3.12.8</li>\n<li><strong>pytest:</strong> 8.3.4</li>\n<li><strong>OpenJDK:</strong> 11.0.25</li>\n<li><strong>Flask:</strong> 3.1.0</li>\n</ul>\n\n<p><strong>Operating System:</strong> Ubuntu 22.04.5 LTS</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-20</p>\n"}, {"fullname": "app.ml_app.logger", "modulename": "app.ml_app", "qualname": "logger", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Logger usaspending (INFO)&gt;"}, {"fullname": "app.ml_app.app", "modulename": "app.ml_app", "qualname": "app", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Flask &#x27;app.ml_app&#x27;&gt;"}, {"fullname": "app.ml_app.spark", "modulename": "app.ml_app", "qualname": "spark", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;pyspark.sql.session.SparkSession object&gt;"}, {"fullname": "app.ml_app.REG_PIPELINE_PATH", "modulename": "app.ml_app", "qualname": "REG_PIPELINE_PATH", "kind": "variable", "doc": "<p></p>\n", "default_value": "&#x27;outputs/pipeline_regression&#x27;"}, {"fullname": "app.ml_app.CLASS_PIPELINE_PATH", "modulename": "app.ml_app", "qualname": "CLASS_PIPELINE_PATH", "kind": "variable", "doc": "<p></p>\n", "default_value": "&#x27;outputs/pipeline_classification&#x27;"}, {"fullname": "app.ml_app.CLUSTER_PIPELINE_PATH", "modulename": "app.ml_app", "qualname": "CLUSTER_PIPELINE_PATH", "kind": "variable", "doc": "<p></p>\n", "default_value": "&#x27;outputs/pipeline_clustering&#x27;"}, {"fullname": "app.ml_app.pipeline_model_reg", "modulename": "app.ml_app", "qualname": "pipeline_model_reg", "kind": "variable", "doc": "<p></p>\n", "default_value": "PipelineModel_b4f26712b5f8"}, {"fullname": "app.ml_app.pipeline_model_class", "modulename": "app.ml_app", "qualname": "pipeline_model_class", "kind": "variable", "doc": "<p></p>\n", "default_value": "PipelineModel_6548e248e214"}, {"fullname": "app.ml_app.pipeline_model_cluster", "modulename": "app.ml_app", "qualname": "pipeline_model_cluster", "kind": "variable", "doc": "<p></p>\n", "default_value": "PipelineModel_fd7e83ad4473"}, {"fullname": "app.ml_app.dashboard", "modulename": "app.ml_app", "qualname": "dashboard", "kind": "function", "doc": "<p>Render the dashboard page with various data visualizations.</p>\n\n<p>This route reads data from Cassandra tables related to award amounts by recipient and\nsub-agency, as well as data for Sankey diagrams and monthly awards. The data is\nprocessed using Spark and passed to the dashboard template for rendering.</p>\n\n<p>Returns:\n    A rendered HTML template for the dashboard.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.show_correlation", "modulename": "app.ml_app", "qualname": "show_correlation", "kind": "function", "doc": "<p>Render the correlation visualization page.</p>\n\n<p>Returns:\n    A rendered HTML template for correlation visualization.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.regression", "modulename": "app.ml_app", "qualname": "regression", "kind": "function", "doc": "<p>Handle regression model inference for award amount prediction.</p>\n\n<p>On GET request:\n    Renders the regression form with default values.</p>\n\n<p>On POST request:\n    Processes form data, performs regression prediction using the loaded pipeline model,\n    and flashes the prediction result.</p>\n\n<p>Returns:\n    A rendered HTML template for regression or a redirect with flashed messages.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.classification", "modulename": "app.ml_app", "qualname": "classification", "kind": "function", "doc": "<p>Handle classification model inference for award amount classification.</p>\n\n<p>On GET request:\n    Renders the classification form with default values.</p>\n\n<p>On POST request:\n    Processes form data, performs classification using the loaded pipeline model,\n    and flashes the classification result with confidence.</p>\n\n<p>Returns:\n    A rendered HTML template for classification or a redirect with flashed messages.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.clustering", "modulename": "app.ml_app", "qualname": "clustering", "kind": "function", "doc": "<p>Handle clustering model inference for award data clustering.</p>\n\n<p>On GET request:\n    Renders the clustering form with default values.</p>\n\n<p>On POST request:\n    Processes form data, performs clustering using the loaded pipeline model,\n    and flashes the cluster ID result.</p>\n\n<p>Returns:\n    A rendered HTML template for clustering or a redirect with flashed messages.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.download_page", "modulename": "app.ml_app", "qualname": "download_page", "kind": "function", "doc": "<p>Render the download page for fetching data.</p>\n\n<p>Returns:\n    A rendered HTML template for the download page.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.fetch_data", "modulename": "app.ml_app", "qualname": "fetch_data", "kind": "function", "doc": "<p>Fetch data from the USASpending API and insert it into Cassandra.</p>\n\n<p>This route handles the data fetching process based on user-specified frequency\nand date range. It fetches data in batches, handles pagination, and inserts\nrecords into the Cassandra database. It also records the download history.</p>\n\n<p>Returns:\n    A redirect to the download page with flashed messages indicating the status.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.ml_app.to_date", "modulename": "app.ml_app", "qualname": "to_date", "kind": "function", "doc": "<p>Convert a string to a date object.</p>\n\n<p>Args:\n    d (str): Date string in the format 'YYYY-MM-DD'.</p>\n\n<p>Returns:\n    datetime.date or None: Converted date object if successful, else None.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"param\"><span class=\"n\">d</span></span><span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.spark_cassandra_etl_award_amount_aggregator", "modulename": "app.spark_cassandra_etl_award_amount_aggregator", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>This module serves as the entry point for the <strong>BigData &amp; Tools USASpending Application</strong>.\nIt performs an Extract, Transform, Load (ETL) process using Apache Spark to aggregate award amounts based on specified\ncriteria\u2014either by recipient name or awarding sub-agency. The application connects to a Cassandra database to read and\nwrite data, ensuring efficient handling of large datasets. Command-line arguments allow users to specify the aggregation\ntype, and comprehensive logging facilitates monitoring and debugging. This module is designed for scalability and\nmaintainability, adhering to best practices in big data processing.</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-21</p>\n"}, {"fullname": "app.spark_cassandra_etl_award_amount_aggregator.logger", "modulename": "app.spark_cassandra_etl_award_amount_aggregator", "qualname": "logger", "kind": "variable", "doc": "<p></p>\n", "default_value": "&lt;Logger usaspending (INFO)&gt;"}, {"fullname": "app.spark_cassandra_etl_award_amount_aggregator.spark_cassandra_aggregator", "modulename": "app.spark_cassandra_etl_award_amount_aggregator", "qualname": "spark_cassandra_aggregator", "kind": "function", "doc": "<p>Executes the ETL process to aggregate award amounts based on the specified aggregator.</p>\n\n<p>This function initializes a Spark session, reads data from Cassandra tables,\nperforms aggregation based on the provided aggregator, and writes the results\nback to a Cassandra table.</p>\n\n<p>Args:\n    aggregator (str): The column to aggregate by. Supported values are\n                      'recipient_name' and 'awarding_sub_agency'.</p>\n\n<p>Raises:\n    SystemExit: If an unsupported aggregator is provided.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"param\"><span class=\"n\">aggregator</span></span><span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.spark_cassandra_etl_award_amount_aggregator.parse_arguments", "modulename": "app.spark_cassandra_etl_award_amount_aggregator", "qualname": "parse_arguments", "kind": "function", "doc": "<p>Parses command-line arguments.</p>\n\n<p>Returns:\n    argparse.Namespace: An object containing the parsed command-line arguments.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">) -> <span class=\"n\">argparse</span><span class=\"o\">.</span><span class=\"n\">Namespace</span>:</span></span>", "funcdef": "def"}, {"fullname": "app.spark_cassandra_groupby", "modulename": "app.spark_cassandra_groupby", "kind": "module", "doc": "<h1 id=\"bigdata-tools-usaspending-application\">BigData &amp; Tools USASpending Application</h1>\n\n<p><img src=\"data:image/svg+xml;base64,\" alt=\"USASpending Explorer\" /></p>\n\n<h3 id=\"module-overview\">Module Overview</h3>\n\n<p>This module performs data aggregation on the USASpending data stored in Cassandra.\nIt reads the \"awards\" table, groups the data by <code>awarding_sub_agency</code> and <code>recipient_name</code>,\nsums the <code>award_amount</code>, and writes the aggregated results to a new Cassandra table\n<code>awarding_sub_agency_by_recipient</code>.</p>\n\n<p>Dependencies:</p>\n\n<ul>\n<li>pyspark</li>\n</ul>\n\n<p>Usage:\n    Run the module as a standalone script to execute the data processing pipeline.</p>\n\n<p><strong>Author:</strong> Buddhi Ayesha\n<strong>Date:</strong> 2024-12-21</p>\n"}, {"fullname": "app.spark_cassandra_groupby.awarding_agency_by_recipient", "modulename": "app.spark_cassandra_groupby", "qualname": "awarding_agency_by_recipient", "kind": "function", "doc": "<p>This function to aggregate award amounts by awarding sub-agency and recipient.</p>\n\n<p>This function initializes a Spark session with Cassandra configurations,\nreads data from the \"awards\" table in the \"usaspending_data\" keyspace,\nperforms a group by operation on <code>awarding_sub_agency</code> and <code>recipient_name</code>,\nsums the <code>award_amount</code>, and writes the aggregated data to the\n\"awarding_sub_agency_by_recipient\" table in Cassandra.</p>\n\n<p>Steps:\n    1. Initialize SparkSession with Cassandra connection settings.\n    2. Load data from the \"awards\" table.\n    3. Group data by <code>awarding_sub_agency</code> and <code>recipient_name</code>.\n    4. Aggregate the <code>award_amount</code> using sum.\n    5. Write the aggregated data to the new Cassandra table.\n    6. Stop the Spark session.</p>\n\n<p>Raises:\n    Any exceptions raised during Spark operations will propagate upwards.</p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}, {"fullname": "app.spark_cassandra_groupby_month", "modulename": "app.spark_cassandra_groupby_month", "kind": "module", "doc": "<p></p>\n"}, {"fullname": "app.spark_cassandra_groupby_month.main", "modulename": "app.spark_cassandra_groupby_month", "qualname": "main", "kind": "function", "doc": "<p></p>\n", "signature": "<span class=\"signature pdoc-code condensed\">(<span class=\"return-annotation\">):</span></span>", "funcdef": "def"}];

    // mirrored in build-search-index.js (part 1)
    // Also split on html tags. this is a cheap heuristic, but good enough.
    elasticlunr.tokenizer.setSeperator(/[\s\-.;&_'"=,()]+|<[^>]*>/);

    let searchIndex;
    if (docs._isPrebuiltIndex) {
        console.info("using precompiled search index");
        searchIndex = elasticlunr.Index.load(docs);
    } else {
        console.time("building search index");
        // mirrored in build-search-index.js (part 2)
        searchIndex = elasticlunr(function () {
            this.pipeline.remove(elasticlunr.stemmer);
            this.pipeline.remove(elasticlunr.stopWordFilter);
            this.addField("qualname");
            this.addField("fullname");
            this.addField("annotation");
            this.addField("default_value");
            this.addField("signature");
            this.addField("bases");
            this.addField("doc");
            this.setRef("fullname");
        });
        for (let doc of docs) {
            searchIndex.addDoc(doc);
        }
        console.timeEnd("building search index");
    }

    return (term) => searchIndex.search(term, {
        fields: {
            qualname: {boost: 4},
            fullname: {boost: 2},
            annotation: {boost: 2},
            default_value: {boost: 2},
            signature: {boost: 2},
            bases: {boost: 2},
            doc: {boost: 1},
        },
        expand: true
    });
